description:
An extraterrestrial race forced to live in slum-like conditions on Earth suddenly finds a kindred spirit in a government agent who is exposed to their biotechnology.

Set in Johannesburg, South Africa, District 9 begins as a mock documentary about the imminent eviction of extraterrestrials from a pathetic shantytown (called District 9). The creatures, it turns out, have been on Earth for years, having arrived sickly and starving. Initially received by humans with compassion and care, the aliens are now mired in blighted conditions typical of long-term refugee camps unwanted by a hostile, host society. With the creatures' care contracted out to a for-profit corporation, the shantytown has become a violent slum. The aliens sift through massive piles of junk while their minders secretly research weapons technology that arrived on the visitors' spacecraft.

